import httpClient from '../httpClients.ts';
import Navbar from './nav';
import Cookies from 'js-cookie';
import { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import { Button } from 'react-bootstrap';
import { ListGroup } from 'react-bootstrap';
import { Card } from 'react-bootstrap';
import EasyEdit, {Types} from 'react-easy-edit';




function SetAddress() {
    const saveCountry = (value) => {
      myData.country=value
    }
    const saveCity = (value) => {myData.city=value}
    const saveStreet = (value) => {myData.street=value}

    const myData = {
      country: "",
      city: "",
      street: ""
    }

    const cancel = () => {console.log("Cancelled")}
    const [message, setMessage] = useState([{}]);


    useEffect(()  => {
        httpClient.get("http://fullstacklb-1931106476.eu-central-1.elb.amazonaws.com:5000/user").then(response => {
        setMessage(response.data)
        myData.country = response.data.country
        myData.city = response.data.city
        myData.street = response.data.street
        console.log(response.data)
    })
    .catch(error => {
        if (error.response.status === 401){
             window.location.href = "/login"
             Cookies.remove('session')
        }
    })

    }, []);

    const UpdateAddress = () => {

        try {
          httpClient.post("http://fullstacklb-1931106476.eu-central-1.elb.amazonaws.com:5000/change/address", myData);

        } catch (error) {
          error.log(error)
          if (error.response.status === 401) {
            alert("Invalid credentials");

          }
        }

      };


    return (
        <div className=""> <Navbar></Navbar>
        <div className="top-0 start-0">

            <Card style={{ width: '18rem'}}>

                    <ListGroup>
                    <ListGroup.Item>BSN: {message.bsn}</ListGroup.Item>

<ListGroup.Item><EasyEdit
      type={Types.TEXT}
      placeholder={message.city}
      onSave={saveCity}
      onCancel={cancel}
      attributes={{ name: "awesome-input", id: 1}}/></ListGroup.Item>

<ListGroup.Item><EasyEdit
      type={Types.TEXT}
      placeholder={message.country}
      onSave={saveCountry}
      onCancel={cancel}
      attributes={{ name: "awesome-input", id: 1}}/></ListGroup.Item>

<ListGroup.Item><EasyEdit
      type={Types.TEXT}
      placeholder={message.street}
      onSave={saveStreet}
      onCancel={cancel}
      attributes={{ name: "awesome-input", id: 1}}/></ListGroup.Item>

                    </ListGroup>
            </Card>

             <Button variant="primary" type="button" onClick={() => UpdateAddress()}>Submit</Button>

        </div>
    </div>


    )
}

export default SetAddress
